客户至上：海尔深刻洞察人们对现代生活的需求：优质生活和优质生活环境。所有的海尔人和海尔的合作伙伴都以真诚的 态度，在研发、采购、生产、物流、服务  等每一个细节中倾心而为，发挥全部潜力和创造力，尽力满足客户的需求， 实现以客户为中心的创新。

缜密的解决方案：海尔不仅充分理解消费者的生活需要，而且深入考虑对环境的综合影响。海尔积极拓展与家居生活相关的  业务领域，对各产品、服务、居家环境、网络等进行全面整合，为消费者量身定制系统化的现代生活解决方案，创造更丰富的生活体验和更优质的生活环境。', '从1984年创业至今，海尔1984年创业到现在，经历了五个发展战略阶段，名牌战略、多元化战略、国际化战略、全球化品牌战略、2012年进入网络化战略阶段。创业30多年来，海尔致力于成为“时代的企业”，每个阶段的战略主题都是随着时代变化而不断变化的，但贯穿海尔发展历程的，都离不开管理创新，重点关注的就是“人”的价值实现，使员工在为用户创造价值的同时实现自身的价值。海尔从2005年提出“人单合一”已经十多年，现在人单合一双赢模式因破解了互联网时代的管理难题而吸引了世界著名商学院、管理专家争相跟踪研究。');
